import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
    return (
        <div className="flex flex-col items-center justify-center min-h-screen bg-gradient-to-r from-blue-500 via-teal-500 to-green-500 p-6">
            <div className="text-center bg-white p-8 rounded-lg shadow-lg border border-gray-200 max-w-md w-full">
                <h1 className="text-5xl font-extrabold text-gray-900 mb-4">
                    Welcome to <span className="text-blue-700">DERMATEL</span>
                </h1>
                <p className="text-lg text-gray-700 mb-8">
                    Your personalized eczema management system
                </p>
                <div className="space-x-4">
                    <Link to="/login">
                        <button className="px-6 py-3 bg-blue-700 text-white font-bold rounded-lg shadow-md hover:bg-blue-800 focus:outline-none focus:ring-2 focus:ring-blue-500 transition duration-150 ease-in-out">
                            Login
                        </button>
                    </Link>
                    <Link to="/register">
                        <button className="px-6 py-3 bg-teal-700 text-white font-bold rounded-lg shadow-md hover:bg-teal-800 focus:outline-none focus:ring-2 focus:ring-teal-500 transition duration-150 ease-in-out">
                            Register
                        </button>
                    </Link>
                </div>
            </div>
        </div>
    );
};

export default HomePage;
